var tipuesearch = {"pages": [{'title': 'About', 'text': '這是計算機程式課程 2021 Fall 的作業倉儲與網站 template \n \n 你的學號: 40923114 \n 網站倉儲:\xa0 https://github.com/40923114/cp2021_hw \n 網站連結:  https://40923114.github.io/cp2021_hw/content/index.html \n 其他與個人或作業相關資料說明或介紹 \n', 'tags': '', 'url': 'About.html'}, {'title': 'Final', 'text': 'yt final video  https://www.youtube.com/watch?v=8zrI9pglv38&ab_channel=%E4%BA%A6%E5%BE%B7%E6%B1%9F \n \n \n \n \n \n  導入 brython 程式庫  \n \n \n  啟動 Brython  \n \n  導入 FileSaver 與 filereader  \n \n \n \n \n  導入 ace  \n \n \n \n \n \n \n  請注意, 這裡使用 Javascript 將 localStorage["py_src"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱 \n \n \n \n  印出版次與關鍵字程式  \n \n \n \n \n  用來顯示程式碼的 editor 區域  \n \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n !-- 存擋表單開始 --> \n Filename:  .py    執行與清除按鈕開始  \n Run   Output   清除輸出區 清除繪圖區 Reload \n  程式執行 ouput 區  \n', 'tags': '', 'url': 'Final.html'}, {'title': 'Exam', 'text': '', 'tags': '', 'url': 'Exam.html'}, {'title': 'w13', 'text': ' 導入 FileSaver 與 filereader  \n \n \n \n \n  導入 ace  \n \n \n \n \n \n \n  請注意, 這裡使用 Javascript 將 localStorage["py_src"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱 \n \n \n \n  印出版次與關鍵字程式  \n \n \n \n \n  用來顯示程式碼的 editor 區域  \n \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n !-- 存擋表單開始 --> \n Filename:  .py    存擋表單結束  \n \n  執行與清除按鈕開始  \n Run   Output   清除輸出區 清除繪圖區 Reload \n  執行與清除按鈕結束  \n \n  程式執行 ouput 區  \n \n', 'tags': '', 'url': 'w13.html'}, {'title': 'H3', 'text': '', 'tags': '', 'url': 'H3.html'}, {'title': 'HW1', 'text': '2.將左右碰撞移動的紅色方塊, 改為先移動到水平畫面置中心點後, 接著上下碰撞移動 https://gist.githubusercontent.com/40923114/cee59bb8bd8372e391ca29fd5dac1628/raw/dfb34fbff572e996351e69148885114c97e808f9/hw1-1 \n 3.讓使用者可以利用按鈕啟動或中斷紅色方塊上下碰撞移動 \n https://gist.githubusercontent.com/40923114/0d995661148217cec88ac3311fd495e7/raw/130f98a2ac3604bda34e50d7d0d6a904bd48715e/hw1-2 \n 4.英文打字 \n https://gist.githubusercontent.com/40923114/1507d3e051a343234d3f7731c89c76c4/raw/2a4d6e67030454da4f1f8f131e127e889801232b/hw1-4 \n \n 5.練習幾次下來比較會打英打了 從第一次打34分多打到第三次變成30分多 我遇到的最大困難是英文切換大小寫跟打特殊符號 \n 6.中文打字 \n https://gist.githubusercontent.com/40923114/c8534d8fb1d83cb1aad5c9b9441d2e4d/raw/4f7cbad179a1edfc6d5e66ad4ed0ebf91ec7a601/hw1-6 \n \n \n \n', 'tags': '', 'url': 'HW1.html'}, {'title': 'HW2', 'text': '心得:之前有做過，再做一次發現做得速度比之前快。已經漸漸熟悉了。 \n HW2 - 可攜程式系統與個人網站佔學期成績 20%. \n HW2 必須在 2021.11.03 22:00 之前完成. \n HW2 具體項目成果回報區 將於 2021.10.25 開啟, 於 \xa0 2021.11.03 22:00 關閉 \n 可攜程式系統與 Python 範例程式收集整理 \n 1. 請準備一個至少 64 GB 大小的 USB 3.0 以上隨身碟 (或外接 SSD), 根據 \xa0 Task2 \xa0 中的說明, 建立自己的可攜程式系統.\xa0 \n 2. 請登入 Github 帳號後, 連線至 \xa0 https://github.com/mdecourse/cp2021_hw \xa0 後, 透過 \xa0 Use this template \xa0 按鈕建立自己的 cp2021_hw 倉儲. 並至該倉儲的 Settings -> Pages -> Source 將 main 分支設為 Github Pages 的 root (也就是選擇將倉儲的 main 分支設為對應網站的根目錄). \n 3. 請將 HW1 與 HW2 的作業內容登錄至個人的 cp2021_hw 倉儲與網站中. (學習如何透過 git 指令修改倉儲中的版本內容) \n 4. 請在個人作業網站的 HW2 區域下增設一個 H2 頁面, 將該網頁標題命名為 run, 可以如 \xa0 run \xa0 頁面中的內容, 並且利用此頁面收集 Python 範例程式. (例如: 可自動執行的貪食蛇: \xa0 https://mde.tw/cp2021/content/run.html?src=https://gist.githubusercontent.com/mdecourse/d306a1f57e53bfd6466eaae20bcb9439/raw/2160a12b9fec9707a120a383ed5d38b9b78a02cf/snake.py \xa0 將 \xa0 https://gist.github.com/mdecourse/d306a1f57e53bfd6466eaae20bcb9439 \xa0 作為 \xa0 https://mde.tw/cp2021/content/run.html \xa0 頁面中 src 變數的值, 就可以在頁面中導入程式碼並執行) \n', 'tags': '', 'url': 'HW2.html'}, {'title': 'run', 'text': '\n \n  導入 brython 程式庫  \n \n \n  啟動 Brython  \n \n  導入 FileSaver 與 filereader  \n \n \n \n \n  導入 ace  \n \n \n \n \n \n \n  請注意, 這裡使用 Javascript 將 localStorage["py_src"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱 \n \n \n \n  印出版次與關鍵字程式  \n \n \n \n \n  用來顯示程式碼的 editor 區域  \n \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n !-- 存擋表單開始 --> \n Filename:  .py    執行與清除按鈕開始  \n Run   Output   清除輸出區 清除繪圖區 Reload \n  程式執行 ouput 區  \n \n', 'tags': '', 'url': 'run.html'}, {'title': 'HW3', 'text': '', 'tags': '', 'url': 'HW3.html'}, {'title': '貪吃蛇', 'text': '\n \n  導入 brython 程式庫  \n \n \n  啟動 Brython  \n \n  導入 FileSaver 與 filereader  \n \n \n \n \n  導入 ace  \n \n \n \n \n \n \n  請注意, 這裡使用 Javascript 將 localStorage["py_src"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱 \n \n \n \n  印出版次與關鍵字程式  \n \n \n \n \n  用來顯示程式碼的 editor 區域  \n \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n !-- 存擋表單開始 --> \n Filename:  .py    執行與清除按鈕開始  \n Run   Output   清除輸出區 清除繪圖區 Reload \n  程式執行 ouput 區  \n \n', 'tags': '', 'url': '貪吃蛇.html'}, {'title': 'Final Project', 'text': 'Final Project 佔學期成績 30% \n Final Project 必須在 2022.01.05 22:00 之前完成 . \n Final Project 具體項目成果回報區 將於 2021.11.09 開啟, 於  2022.01.05 22:00 關閉 \n 利用 Brython 寫一個會 令人想玩 的網際遊戲. \n 參考章節: \n \n 專題摘要 \n 資料蒐集 \n 設計動機 \n 設計方法 \n 結果與討論 \n 附錄 \n \n 參考資料: \n https://github.com/collections/web-games \n https://github.com/topics/web-game \n https://github.com/topics/browser-game \n https://github.com/leereilly/games \n https://bmsleight.github.io/brython-blocks/ \n https://github.com/mdecourse/brython-blocks \n', 'tags': '', 'url': 'Final Project.html'}, {'title': '期末總結', 'text': '', 'tags': '', 'url': '期末總結.html'}]};